import React from 'react';

function CategoryList(props){

    return (

       <React.Fragment>
           {
               props.categories.map( category=>{
                   return <h3 key = {category.id}>{category.title}</h3>
               })
           }
       </React.Fragment>

    );
}

export default CategoryList
